  "text" : "RT @chenglap: \u9670\u8B00\u8AD6\u61C9\u7528\u5BE6\u52D9: \u90A3\u908A\u6709\u4E00\u500B\u76F2\u4EBA\u76F2\u4E86, \u4ED6\u53EF\u80FD\u662F\u6545\u610F\u523A\u76F2\u81EA\u5DF1\u96D9\u773C\u53BB\u8B93\u4EBA\u758F\u65BC\u9632\u7BC4, \u535A\u53D6\u540C\u60C5. \u9019\u908A\u6709\u4E00\u500B\u4EBA\u8D64\u8CA7, \u4ED6\u53EF\u80FD\u6642\u5E74\u9752\u4E86\u505A\u4E86\u5F88\u591A\u58DE\u4E8B, \u5F97\u5230\u5831\u614B\u800C\u8D64\u8CA7. \u9019\u88E1\u6709\u4EBA\u6559\u4EBA\u4E0D\u8981\u8AAA\u8B0A, \u4ED6\u53EF\u80FD\u662F\u60F3\u5C11\u4E9B\u4EBA\u8AAA\u8B0A, \u597D\u8B93\u81EA\u5DF1\u8AAA\u8B0A\u7684\u6642\u5019\u66F4\u53EF\u80FD\u6210\u529F. \u9670 ...",
